import ExpenseItem from "./ExpenseItem";
import "./ListOfExpenses.css";

function ListOfExpenses(props) {
const expenses = props.expenses;
  return (
    <div className="expenses">
        <h2>{expenses[1].title}</h2>
    </div>
  );
}

export default ListOfExpenses;
